import React from 'react';
import Post from "./Post";

const AllPosts = ([posts]) => {
    console.log(posts)
    return (
        <div>
            <h1 className="App__header">Post list</h1>
            {posts.map(post =>
                <Post post={post} key={post.id} />
            )}
        </div>
    );
};

export default AllPosts;
